import{_ as e}from"./chunks/creator-start.fb4bb6fb.js";import{_ as a,c as i,o,d as r}from"./app.8706ebaa.js";const t="/CraftContainers/assets/blueprint-origin.edb85362.png",l="/CraftContainers/assets/markers.d85c432c.png",w=JSON.parse('{"title":"Kreator Blueprint","description":"","frontmatter":{},"headers":[{"level":2,"title":"Komendy","slug":"komendy","link":"#komendy","children":[]},{"level":2,"title":"Zalecany format nazwy szablonu","slug":"zalecany-format-nazwy-szablonu","link":"#zalecany-format-nazwy-szablonu","children":[{"level":3,"title":"Przyk\u0142ad","slug":"przyk\u0142ad","link":"#przyk\u0142ad","children":[]}]},{"level":2,"title":"Punkt origin schematu","slug":"punkt-origin-schematu","link":"#punkt-origin-schematu","children":[]},{"level":2,"title":"Kluczowe lokacje","slug":"kluczowe-lokacje","link":"#kluczowe-lokacje","children":[{"level":3,"title":"Ustawienie lokacji","slug":"ustawienie-lokacji","link":"#ustawienie-lokacji","children":[]},{"level":3,"title":"Pobieranie lokacji","slug":"pobieranie-lokacji","link":"#pobieranie-lokacji","children":[]}]},{"level":2,"title":"Przyk\u0142ady","slug":"przyk\u0142ady","link":"#przyk\u0142ady","children":[]}],"relativePath":"pl/learn/blueprint.md"}'),n={name:"pl/learn/blueprint.md"},c=r('<h1 id="kreator-blueprint" tabindex="-1">Kreator Blueprint <a class="header-anchor" href="#kreator-blueprint" aria-hidden="true">#</a></h1><p>Kreator to wbudowane narz\u0119dzie umo\u017Cliwiaj\u0105ce modyfikacj\u0119 schemat\xF3w budowli oraz lokacji kluczowych w schemacie. Zosta\u0142 zaprojektowany tak, aby m\xF3g\u0142 z niego korzysta\u0107 ka\u017Cdy, nawet bez umiej\u0119tno\u015Bci programowania. Pozwala na tworzenie nowych szablon\xF3w budowli oraz edycj\u0119 istniej\u0105cych.</p><h2 id="komendy" tabindex="-1">Komendy <a class="header-anchor" href="#komendy" aria-hidden="true">#</a></h2><ul><li><code>/blueprint</code><ul><li><code>edit &lt;nazwa&gt;</code> - Opens the editor using an existing schematic or creates a new file.</li><li><code>save</code> - Saves the currently edited schematic without exiting.</li><li><code>exit</code> - Exits the editor.</li><li><code>radius &lt;number&gt;</code> - Sets the maximum size of the schematic. (size = 2*radius-1)</li></ul></li><li><code>/marker</code><ul><li><code>addhere &lt;nazwa&gt;</code> - Creates a marker at the player\u2019s current position.</li><li><code>removeid &lt;id&gt; </code> - Removes a specific marker by its ID.</li><li><code>removename &lt;name&gt;</code> - Removes all markers with the specified name.</li><li><code>givemarkerblock &lt;name&gt;</code> - Gives the player a block that creates a marker at the placement location.</li><li><code>giveclearblock</code> - Gives a block that deletes markers at the placement location.</li><li><code>list</code> - Displays all markers grouped by name.</li><li><code>list &lt;name&gt;</code> - Display all markers in group.</li><li><code>tp &lt;id&gt;</code> - Teleports the player to the specified marker.</li></ul></li></ul><h2 id="zalecany-format-nazwy-szablonu" tabindex="-1">Zalecany format nazwy szablonu <a class="header-anchor" href="#zalecany-format-nazwy-szablonu" aria-hidden="true">#</a></h2><p>Aby unikn\u0105\u0107 konflikt\xF3w mi\u0119dzy nazwami szablon\xF3w i u\u0142atwi\u0107 identyfikacj\u0119 pluginu, z kt\xF3rego pochodzi dany szablon, stosuj format <code>&lt;nazwa_pluginu&gt;#&lt;nazwa_szablonu&gt;</code> pisany ma\u0142ymi literami.</p><h3 id="przyk\u0142ad" tabindex="-1">Przyk\u0142ad <a class="header-anchor" href="#przyk\u0142ad" aria-hidden="true">#</a></h3><ul><li><code>/blueprint edit bedwars#arena1</code></li><li><code>/blueprint edit duelspvp#arena1</code></li></ul><p><img src="'+e+'" alt="uruchomienie kreatora"> Je\u015Bli szablon nie istnieje, zostanie utworzony nowy, domy\u015Blny szablon.</p><h2 id="punkt-origin-schematu" tabindex="-1">Punkt origin schematu <a class="header-anchor" href="#punkt-origin-schematu" aria-hidden="true">#</a></h2><p>Origin okre\u015Bla punkt odniesienia, wzgl\u0119dem kt\xF3rego schemat b\u0119dzie wklejany do \u015Bwiata.</p><p><img src="'+t+'" alt="punkt \u015Brodka"></p><h2 id="kluczowe-lokacje" tabindex="-1">Kluczowe lokacje <a class="header-anchor" href="#kluczowe-lokacje" aria-hidden="true">#</a></h2><p>Kluczowe lokacje to specjalne punkty oznaczone w edytorze, do kt\xF3rych mo\u017Cna p\xF3\u017Aniej odwo\u0142ywa\u0107 si\u0119 w kodzie.</p><h3 id="ustawienie-lokacji" tabindex="-1">Ustawienie lokacji <a class="header-anchor" href="#ustawienie-lokacji" aria-hidden="true">#</a></h3><p>Za pomoc\u0105 komendy <code>/markers</code>. <img src="'+l+'" alt="kluczowe lokacje"></p><h3 id="pobieranie-lokacji" tabindex="-1">Pobieranie lokacji <a class="header-anchor" href="#pobieranie-lokacji" aria-hidden="true">#</a></h3><ul><li><p><code>@NotNull List&lt;Marker&gt; requireAnyByName(String name)</code><br> Wymaga co najmniej jednego markera o podanej nazwie (inaczej wyj\u0105tek).</p></li><li><p><code>@NotNull Marker requireOneByName(String name)</code><br> Wymaga dok\u0142adnie jednego markera o podanej nazwie (inaczej wyj\u0105tek).</p></li><li><p><code>@NotNull Location requireOneLocationByName(String name)</code><br> Wymaga dok\u0142adnie jednego markera i zwraca jego lokalizacj\u0119.</p></li><li><p><code>@NotNull List&lt;Location&gt; requireAnyLocationsByName(String name)</code><br> Wymaga co najmniej jednego markera i zwraca ich lokalizacje.</p></li></ul><details><summary>Pozosta\u0142e metody</summary><ul><li><p><code>@NotNull Location getBase()</code><br> Zwraca bazow\u0105 lokalizacj\u0119 wed\u0142ug, kt\xF3rej zosta\u0142y wyliczone markery.</p></li><li><p><code>@NotNull List&lt;Marker&gt; getMarkers()</code><br> Pobiera wszystkie istniej\u0105ce markery.</p></li><li><p><code>@Nullable Marker getById(int id)</code><br> Pobiera marker na podstawie jego identyfikatora lub <code>null</code>.</p></li><li><p><code>@NotNull List&lt;Marker&gt; getByName(String name)</code><br> Pobiera wszystkie markery o podanej nazwie (mo\u017Ce by\u0107 pusta lista).</p></li><li><p><code>@NotNull List&lt;Marker&gt; getNearbyMarkers(Location location, double radius)</code><br> Pobiera wszystkie markery w zadanym promieniu od lokalizacji.</p></li></ul></details><h2 id="przyk\u0142ady" tabindex="-1">Przyk\u0142ady <a class="header-anchor" href="#przyk\u0142ady" aria-hidden="true">#</a></h2><p>Aby zobaczy\u0107, jak wykorzysta\u0107 przygotowane schematy i markery w praktyce, zajrzyj do sekcji <a href="/CraftContainers/pl/learn/gamemap-generating.html">Generowanie mapy</a>, gdzie znajdziesz przyk\u0142ady statycznego i dynamicznego wczytywania map oraz pobierania kluczowych lokacji.</p>',21),d=[c];function s(k,u,m,p,y,h){return o(),i("div",null,d)}const b=a(n,[["render",s]]);export{w as __pageData,b as default};
